function loadData(itemType,tableBody,callback){AWS.config.region="us-west-2";AWS.config.credentials=new AWS.CognitoIdentityCredentials({IdentityPoolId:"us-west-2:6b9951e5-3d36-4f20-86bd-945a50f8312d"});var dynamodb=new AWS.DynamoDB({apiVersion:"2012-08-10",params:{TableName:"AQ3D-Spreadsheet"}});var params={TableName:"AQ3D-Spreadsheet",ExpressionAttributeValues:{":v":{S:itemType}},KeyConditionExpression:"ItemType = :v",ScanIndexForward:true};dynamodb.query(params,function(err,data){if(!err){var items=data.Items;for(var i=0;i<data.Count;i++){var item=items[i];var row=tableBody.insertRow();row.insertCell(0).innerHTML='<a target="_blank" href='+item.Link.S+">"+item.ItemName.S+"</a>";row.insertCell(1).innerText="Level "+item.Level.N;row.insertCell(2).innerText=item.Health.S+" Health";row.insertCell(3).innerText=item.Mana.S+" Mana";row.insertCell(4).innerText=item.Attack.S+" Attack";row.insertCell(5).innerText=item.Defense.S+" Defense";row.insertCell(6).innerText=item.Dodge.S+" Dodge";row.insertCell(7).innerText=item.Hit.S+" Hit";row.insertCell(8).innerText=item.Crit.S+" Crit";row.insertCell(9).innerText=item.CritPower.S+" Crit Power"}callback()}})}
